INSERT INTO `FeedMessages` VALUES (1,1,'Start av hemsida!','Syftet med hemsidan är att den ska fungera som ytterliggare en kanal för information från styrelsen. T ex om något händer med vattnet så meddelar vi det här så fort som möjligt.<br/>Du kan läsa mer om hemsidans funktioner i filen \'Dokumentation om Norruddens hemsida\' under avdelningen \'Dokument\'.','http://jbossas-norrudden.rhcloud.com','1418125198717','2014-12-09 11:39:58');
